DELIMITER $$
--
-- Procedures
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_GetAllConversationByUsername` (IN `username` VARCHAR(40))  BEGIN
 	SELECT * 
 	FROM conversation
	WHERE user1 = username OR user2 = username;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_GetAllConversationGroupByUsername` (IN `user_name` VARCHAR(40))  BEGIN
		SELECT tb1.*, tb2.content, tb2.last_message_time
		FROM 
            (SELECT c.*
            FROM conversation c
            WHERE  c.id IN (SELECT c.id
                            FROM conversation_user cu2, conversation c
                            WHERE cu2.conversation_id = c.id AND c.is_group = 1 AND cu2.username = user_name)
		ORDER BY c.id asc) as tb1
        LEFT JOIN

        (SELECT m.conversation_id, m.content, m.created_at as last_message_time
                        FROM message m, (SELECT conversation_id, MAX(id) as last_id
                                         FROM message m
                                         GROUP BY conversation_id) as t1
                        WHERE m.id = t1.last_id) as tb2
		ON tb1.id = tb2.conversation_id;
	END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_GetAllConversationPrivateByUsername` (IN `user_name` VARCHAR(40))  BEGIN
  		SELECT tb1.*, tb2.content, tb2.last_message_time
        FROM
                (SELECT cu1.*, u.name,u.avatar
                FROM conversation_user cu1, user u 
                WHERE cu1.username = u.username AND cu1.username != user_name AND cu1.conversation_id IN (SELECT c.id
                                                                        FROM conversation_user cu2, conversation c
                                                                        WHERE cu2.conversation_id = c.id AND c.is_group = 0 AND cu2.username = user_name)
                ORDER BY cu1.created_at DESC, cu1.conversation_id DESC) as tb1
                LEFT JOIN
                (SELECT m.conversation_id, m.content, m.created_at as last_message_time
                FROM message m, (SELECT conversation_id, MAX(id) as last_id
                                 FROM message m
                                 GROUP BY conversation_id) as t1
                WHERE m.id = t1.last_id) as tb2
                ON tb1.conversation_id = tb2.conversation_id;
	END$$

DELIMITER ;

